import React, { Component } from "react";
 
class About extends Component {
  render() {
    return (
      <div>
        <h2>About Us</h2>
        <p>We have been a family owned business for over 30 years. We are committed to providing great customer service.  Cell phone service, computer repair, networking, and internet services are just a few of the electronic needs we can assist you with. Thank you to all customers who have and continue to support us throughout the years.</p>
      </div>
    );
  }
}
 
export default About;
